import React, {Component} from "react";
import "./App.css";
import {Form, FormGroup, Input, Label} from "reactstrap";
import {Map, GoogleApiWrapper} from 'google-maps-react';

class ver extends Component {

  constructor(props){
  super(props);
  state = {
    fields: {}
  };


  this.state = {
    stores: [{lat: 47.49855629475769, lng: -122.14184416996333},
            {latitude: 47.359423, longitude: -122.021071},
            {latitude: 47.2052192687988, longitude: -121.988426208496},
            {latitude: 47.6307081, longitude: -122.1434325},
            {latitude: 47.3084488, longitude: -122.2140121},
            {latitude: 47.5524695, longitude: -122.0425407}]
  }}

  displayMarkers = () => {
    return this.state.stores.map((store, index) => {
      return <Marker key={index} id={index} position={{
       lat: store.latitude,
       lng: store.longitude
     }}
     onClick={() => console.log("You clicked me!")} />
    })
  }


  render() {
    console.log('this.props => ', this.props);
    const {values = {}} = this.props.location;
    const {
      firstName, lastName, state,city,address,pincode,birthDate,
      education,feet,inches,phoneNumber,email
    } = values;
    console.log('values => ', values);
    return (
      <div className="ver">
      <div className="container">
        <div>
          <div className="card">
      <span><div className="card-header font-weight:bold text-center ">
      <h2>CSC 642 Summer 2020 Individual Assignment Megha Babariya</h2>
      </div></span></div>
          <Form className="login-form">
            <h1><span className="font-weight-bold">Data Survey Verification Form</span></h1>
            <FormGroup>              
                <h5> First Name :{firstName}</h5>
                <h5> Last Name : {lastName} </h5>   
                <h5>State :{state} </h5>   
                <h5> City : {city} {pincode} </h5>        
                <h5>address : {address}</h5>
                <h5> Education: {education}</h5>
                <h5> Birthdate : {birthDate}</h5>
                <h5>Height : Feet {feet} inches {inches}</h5>
                <h5>Phone Number: {phoneNumber}</h5>
                <h5> Email : {email}</h5>

                <Map
          google={this.props.google}
          zoom={8}
          style={mapStyles}
          initialCenter={{ lat: 47.444, lng: -122.176}}
        >
          {this.displayMarkers()}
        </Map>
              </FormGroup>
              </Form>

        {/* <p>hello {firstName} {lastName}</p> */}
      </div></div></div>
    );
  }
}

export default ver;
